pragma solidity ^0.8.14;

contract Enum {
    enum Days {
        Sun,
        Mon,
        Tue,
        Web,
        Thu,
        Fri,
        Sat
    }

    enum Status {
        Pending,
        Shipped,
        Accepted,
        Rejected
    }

    Days public day = Days.Mon;

    Status private status;

    function getStatus() public view returns(Status) {
        return status;
    }

    function setStatus(Status _status) public view returns(Status) {
        return status;
    }
}

